import React from 'react';

class Header extends React.Component{

    render(){

        return(
            <header>
                <div className="logo"></div>
                <ul className="nav-bar">
                    <li>Home</li>
                    <ul>
                        <li>Shopping</li>
                        <li>Man</li>
                        <li>Women</li>
                    </ul>
                    <li>About Us</li>
                    <li>Contact Us</li>
                    <li>My Account</li>
                </ul>
            </header>
        );
    }

}

export default Header;
